(65013, '9EE401CB-925C-4C98-BB38-C863618C1AD7', 'Hey love, I’m sorry for speaking harshly this morning to you by saying “this is why you are in court” in response to you sharing what happened with maya reading your text messages. I realize that is an unfair comparison and that it felt hurtful to you. Im grateful to you for your support for nathan. The fact that he reaches out to you for guidance and feedback in this tough situation is a testament to the trust you have built with him….because he knows how much you care and love him.', 'David', 'Nitzan', '2023-01-30T09:40:36.581859'),
(65014, '85B8465E-A151-4042-A350-67A60CE5A89D', 'Thanks love for this note. I️ appreciate it. ', 'Nitzan', 'David', '2023-01-30T09:52:46.411842'),
(65015, 'FA032B61-1AB2-4585-83CF-02088D6F771B', 'I️ appreciate you taking care of Orli these last few days so that I️ could have some down time and friend time. I’m very grateful for that. ', 'Nitzan', 'David', '2023-01-30T09:53:10.970819'),
(65016, 'D0974FFC-47F7-4265-A5F5-85686BE5DEBE', 'The stuff with Nathan is complicated but you are right — he reaches out and shares because we have a deep connection. And I’m ok with us having a different opinion on what I’m saying in the privacy of our own conversations. I️ think the bigger question is what you (or I️) should do with larger “opinions” which sound very close to judgements. I️ feel hurt by your judgement. ', 'Nitzan', 'David', '2023-01-30T09:55:01.783337'),
(65017, '13150715-5168-4DEA-AC54-B21D224D506E', 'And I️ don’t really see the benefit in you sharing it. It doesn’t create a safe space. It doesn’t create an environment where I️ want to share or be vulnerable with you,', 'Nitzan', 'David', '2023-01-30T09:56:57.853588'),
(65018, 'E47440A6-4191-462E-82F3-C261A5E99153', 'It just makes me want to hide. ', 'Nitzan', 'David', '2023-01-30T09:57:06.784806'),
(65019, '4E66176F-4E81-4E4D-AEE3-B2FFD4BB5EA4', 'But of course, all of us have opinions. ', 'Nitzan', 'David', '2023-01-30T09:57:18.099807'),
