(65021, '4CE22478-2736-4C7C-AC0F-EEEA2F1783EB', 'But I️ oftentimes keep them to myself because I️ don’t really see the purpose of sharing them in a raw way.', 'Nitzan', 'David', '2023-01-30T09:57:46.125162'),
(65023, 'CA8FDDBB-4F1D-4DEF-A8D4-E888F3871750', 'For what it’s worth, there’s not one CEO I️ have talked to in the last few months that hasn’t had a law suit. I️ wouldn’t say that there aren’t learnings for me — there most certainly are. I️ know what I️ won’t do again for sure. But to fling that in my face just feels like you don’t really understand how crazy the environment is out there for law suits. Elizabeth had to pay 75k to someone last week. And it’s easy to judge. ', 'Nitzan', 'David', '2023-01-30T09:59:49.775281'),
(65026, '835446EE-4377-4BB3-A8B6-C4681ED01113', 'I understand that your lawsuit is totally crazy and unwarranted and is an example of toxic culture + easy loopholes for people to abuse in the legal system. I don’t envy any public leader pushing for change … because everyone is now a target….which makes it even more important to be very careful what one says, to whom, and in what forum. We clearly have different approaches and opinions on what this looks like in practice. And yes, even when one does everything “right”  there is a risk of “no good deed goes unpunished.”  I honor your courage and the work you do every day. It is incredibly difficult.', 'David', 'Nitzan', '2023-01-30T10:44:48.163000'),
(65053, 'D814247D-75BF-4F47-AEB9-49098E3CE20F', 'Thanks love for helping to de-escalate ', 'Nitzan', 'David', '2023-01-30T11:44:05.322055'),
