(65084, 'CD88BDB5-8770-4CC4-83E5-0E7112FFAAEA', 'Love, as I head out on my date, I want to offer an amended apology. I’m sorry for being reactive and judgemental in how I spoke to you by saying that not being careful with your words is why you are going to court. I know that this hurt you and that every time I speak this way, it makes it more difficult for you to feel safe and open to difficult, vulnerable conversations. I will continue my work to be more aware and present and less reactive in the moment.  I also want to repeat again what I said this afternoon….maybe slightly differently. I am in love with your gigantic, giving heart, which is an inspiration to me every day. You give tirelessly to others to help them improve their lives and to me so that we can build a loving vibrant and, yes, sometimes challenging life together. I feel the deepest of gratitude to you for making such a rich life possible. I feel blessed every day to have the gift of you as my partner….even (maybe especially) the days/nights apart. It felt so good to wrap myself around you last night, and welcome you home. I appreciate the gift of a little play time tonight, and the enormous gift….to come home to reconnect with you.  I love you so very much…you are the most precious gift of all. But a small gift awaits when you come home…a tree with a few special leaves for you (it’s almost tubishvat??) that we can add to over the month… Love you so very much!', 'David', 'Nitzan', '2023-01-30T17:30:51.947359'),
(65087, 'BD0E1C34-B2C6-4A3E-AE19-FDBCCBD4002B', 'Thank you my sweets for this. I️’be been in a funk all day from our fight this morning. This note makes me feel heard and seen. I️ really really appreciate it. You are a man I️ admire and respect so deeply. Your self accountability and willingness to stretch and grow is literally second to none. I️ am grateful to you for being such a deep learner and listener. Have an awesome time with Rae. When is a good time for me to expect that you’ll be home…just so that I️’m not waiting around and feeling anxious. Thanks for helping to manage my expectations.', 'Nitzan', 'David', '2023-01-30T17:45:46.875460'),
